<?php
header("Access-Control-Allow-Origin: *");
header("Access-Control-Allow-Methods: GET, POST, OPTIONS");
header("Access-Control-Allow-Headers: Content-Type");

require_once('../../../connection/connection.php');

if ($_SERVER['REQUEST_METHOD'] === 'POST') {
    $employee_id = $_POST['employee_id'];
    $employee_name = $_POST['employee_name'];
    $department_id = $_POST['department_id'];
    $position_id = $_POST['position_id'];
    $company_id = $_POST['company_id'];
    $gender = $_POST['gender'];
    $employee_pob = $_POST['employee_pob'];
    $employee_dob = $_POST['employee_dob'];
    $employee_nationality = $_POST['employee_nationality'];
    $employee_identity = $_POST['employee_identity'];
    $employee_jamsostek = $_POST['employee_jamsostek'];
    $employee_status = $_POST['employee_status'];
    $employee_religion = $_POST['employee_religion'];
    
    $document = "";

    $base64 = "";

    $query = "INSERT INTO employee (employee_id, employee_name, employee_status_id, department_id, position_id, company_id, gender, employee_pob, employee_dob, employee_nationality, employee_identity, employee_jamsostek, employee_status, employee_religion, employee_spv, employee_image) 
              VALUES ('$employee_id', '$employee_name', 'ES-HR-001', '$department_id', '$position_id', '$company_id', '$gender', '$employee_pob', '$employee_dob', '$employee_nationality', '$employee_identity', '$employee_jamsostek', '$employee_status', '$employee_religion', '0000000026', '$base64')";

    if (mysqli_query($connect, $query)) {
        $search_id_query = "SELECT id FROM employee WHERE employee_name = '$employee_name'";
        $search_id_result = mysqli_query($connect, $search_id_query);
        $id_row = mysqli_fetch_assoc($search_id_result);
        $id = $id_row['id'];

        $check_user_query = "SELECT username FROM users WHERE employee_id = '$id'";
        $check_user_result = mysqli_query($connect, $check_user_query);

        $check_is_user_already_exist_rows = $check_user_result->fetch_assoc();
        
        if ($check_is_user_already_exist_rows !== null) {
            http_response_code(300);
            echo json_encode(array("message" => "User already exists"));
        } else {
            $employee_data_query = "SELECT DISTINCT em.employee_name FROM employee em WHERE em.id = '$id';";
            $employee_data_result = mysqli_query($connect, $employee_data_query);

            if ($employee_data_rows = $employee_data_result->fetch_assoc()) {
                $employee_name = $employee_data_rows['employee_name'];
                $name_full = explode(" ", $employee_name, 2);
                $first_char = $name_full[0];

                $random_user_number = rand(1000, 9999);
                $username_set = $first_char . $random_user_number;

                $default_password = '123456';
                $password = password_hash($default_password, PASSWORD_DEFAULT);

                date_default_timezone_set('Asia/Jakarta');
                $date_now = date('Y-m-d h:i:s', time());

                $company_id_query = "SELECT employee.company_id FROM employee WHERE employee.id = '$id' ;";
                $company_id_result = $connect->query($company_id_query);

                while ($company_id_rows = $company_id_result->fetch_assoc()) {
                    $company_id = $company_id_rows['company_id'];
                }

                $insert_user_query = "INSERT INTO users (username, password, employee_id, company_id, created_at) VALUES ('$username_set', '$password', '$id', '$company_id', '$date_now')";
                $user_input_process = mysqli_query($connect, $insert_user_query);
                
                $insert_education_history = "INSERT INTO `employee_education_history`(`id`, `index`) VALUES ('$id', 1)";
                $education_process = mysqli_query($connect, $insert_education_history);

                $insert_emergency_contact = "INSERT INTO `employee_emergency_contact`(`id`, `index`) VALUES ('$id', 1)";
                $emergency_process = mysqli_query($connect, $insert_emergency_contact);

                $insert_employement_contact = "INSERT INTO `employee_employement_history`(`id`, `index`) VALUES ('$id', 1), ('$id', 2), ('$id', 3);";
                $employement_process = mysqli_query($connect, $insert_employement_contact);

                $insert_language = "INSERT INTO `employee_language_professional`(`id`, `index`) VALUES ('$id', 1), ('$id', 2), ('$id', 3), ('$id', 4);";
                $language_process = mysqli_query($connect, $insert_language);
                
                $insert_contact = "INSERT INTO `employee_contact_details_db`(`id`, `employee_email`, `employee_phone_number`) VALUES ('$id', 'null@gmail.com', '000');";
                $contact_process = mysqli_query($connect, $insert_contact);

                $insert_doc = "INSERT INTO `employee_docs_agreement`(`id`, `is_agree`, `file_ktp`, `file_sim_a`, `file_sim_c`, `file_npwp`, `file_bpjs`) VALUES ('$id','[value-2]','$document','$document','$document','$document','$document')";
                $doc_process = mysqli_query($connect, $insert_doc);

                if ($user_input_process && $education_process && $emergency_process && $employement_process && $language_process && $contact_process && $doc_process) {
                    http_response_code(200);
                    echo json_encode(array("message" => "User inserted successfully"));
                } else {
                    http_response_code(400);
                    echo json_encode(array("message" => "Failed to insert user . mysqli_error($connect)"));
                }

            } else {
                http_response_code(400);
                echo json_encode(array("message" => "Failed to retrieve additional data $id"));
            }
        }

    } else {
        http_response_code(404);
        echo json_encode(
            array(
                "StatusCode" => 404,
                'Status' => 'Error',
                "message" => "Error: Unable to insert data - " . mysqli_error($connect)
            )
        );
    }
} else {
    http_response_code(404);
    echo json_encode(
        array(
            "StatusCode" => 404,
            'Status' => 'Error',
            "message" => "Error: Invalid method. Only POST requests are allowed."
        )
    );
}

?>